import reduce from 'lodash.reduce';
const handleReduce = (acc, [code, description]) => {
    if (!acc.hasOwnProperty(code))
        acc[code] = description;
    return acc;
};
const parseResponse = (data) => {
    if (data) {
        const totalResults = data[0];
        const codes = data[1];
        const codesAndNames = data[3];
        return {
            results: reduce(codesAndNames, handleReduce, {}),
            total: totalResults,
            codes,
        };
    }
    return null;
};
export default parseResponse;
